import { Container, Row, Col } from "react-bootstrap";

const CertificationContent = () => {
  return (
    <>
      <Container>
        <Row className="mt-5 neon-border m-2" xs={12} lg={6}>
          <Col xs={12} lg={6}>a</Col>
          <Col xs={12} lg={6}>b</Col>
        </Row>
        <Row className="mt-5 neon-border m-2">
          <Col xs={12} lg={6}>a</Col>
          <Col xs={12} lg={6}>b</Col>
        </Row>
      </Container>
    </>
  );
};

export default CertificationContent;
